import Data from "../BirdList.json"

function Search(props) {



    const styles = {
        image: {

            width: '10%',
            height: 'auto',

        },
        div: {

            display: 'flex',
            flexDirection: 'row',

        }
    }
    return (
        <>

            <div>
                {Data.map((post, i) => {
                    <>
                        <h4 key={post.name}>Name: {post.name}</h4>
                        <h4 key={post.livedate}>Live Date:{post.livedate}</h4>
                        <h4 key={post.role}>Role: {post.role}</h4>
                        <a key={post.github} href={post.github}>Github Link</a>
                        <a key={post.deployment} href={post.deployment}>Deployed Link</a>
                        <img key={post.images} src={post.images}></img>
                    </>
                })}
            </div>
            <h2>Please add sightings or common and rare birds via the submit a sighting page</h2>

            <div style={styles.div}>
                <img style={styles.image} src="/UntitledTwo.png" alt="Yellow duck" />
                <img style={styles.image} src="/Untitled.png" alt="Yellow duck" />
            </div>

        </>
    )
}

export default Search
